import React from "react";
import styled from "styled-components";

const OfferProduct = ({ product }) => {
  const {
    productName,
    productDescription,
    gameType,
    prize,
    amount,
    productImg,
  } = product;
  return <div></div>;
};

export default OfferProduct;
